/* Generated File Run.js in Project good */	function close_good(){	Minimizer.close("good");}	function minimize_good(){	Minimizer.minimize("good");}	function maximize_good(){	Minimizer.maximize("good");}function open_good(){}/* Initialize application */			function init_good(){	$("#body-good").keypress(function(event) {	}).mouseover(function(){	    $("#good-container").draggable({disabled:true});    }).mouseout(function(){        $("#good-container").draggable({disabled:false});    });		$("#good-container").mousedown(function(){		Focus.set("good");		setMenu_good();			fixSizegoodSpeed = 0;	})	.mouseup(function(){		fixSizegoodSpeed = 300;	});		/* Make application resizable */	Resizable.set("good");		$("#exit-good").mousedown(function(){		close_good();		$("#body-good").val("");	});	$("#maximize-good").mousedown(function(){		maximize_good()	});		$("#minimize-good").mousedown(function(){		minimize_good()	});			fixSize_good();        color = ['#F00','#FF0', '#0F0', '#0FF', '#00F'];    idColor = 0;    $('#good-button1').click(function(){        $('#good-container').css({background:color[idColor]});        if(idColor < color.length-1)            idColor++;        else            idColor = 0;    });}/* Fix size application */var fixSizegoodSpeed = 300;function fixSize_good(){	setTimeout(function(){		if(LoadAppsID["good"].onFocus){			height = $("#good-container").height();			width = $("#good-container").width();			$("#body-good").css({"height" : height-45, "width" : width-5});		}		fixSize_good();	},fixSizegoodSpeed);}/* Set application menu */function setMenu_good(){	proIdApps = "good";	var valMenu = "<span id=top-menu-item0 class=top-menu-item>Good</span>"+        "<ul id=top-menu-item0-down class=top-menu-item-down>"+            "<li onclick=minimize_good(proIdApps)>Minimize</li>"+			"<li onclick=maximize_good(proIdApps)>Maximize</li>"+			"<li onclick=close_good(proIdApps)>Quit Good</li>"+        "</ul>";		$("#top-menu").html(valMenu);		Menu.fixedTopMenu();}/* Register application */function register_good(){	$.post("system/applications/good/layout/good.html", function(data){		ApplicationRun[applicationOpened] = data;		ApplicationRun[applicationOpened] = ApplicationRun[applicationOpened];		$(".program").html(($(".program").html())+ApplicationRun[applicationOpened]);		setTimeout(init_good,100);		fixSize_good();		applicationOpened++;	});	}/* Running application */function run_good(dir, fileName){}